import "./ContactContent.css"
import contactInfo from "../data/contactInfo.json"



export default function ContactContent() {


    return (

        <div className="ContactContainer">

            <div className="ContactContent">
                <div className="contactInfo">
                    <h2 className="headerContactInfo">Contact info</h2>
                    {contactInfo.contactInfo.map(info => (
                        <>
                            <div className="infoItems" key={1}>
                                <h3>
                                    <i className={info.LocationIcon}></i> {info.Location}
                                </h3>
                                <p>
                                    <i className={info.EmailIcon}></i> {info.Email}
                                </p>
                                <p>
                                    <i className={info.PhoneNumberIcon}></i> {info.PhoneNumber}
                                </p>
                                {/* <p>
                                    <i className={info.FaxIncon}></i> {info.Fax}
                                </p> */}
                            </div>
                        </>
                    ))}
                    {/*<p><i className="fa-solid fa-fax"></i>121312312312</p> */}
                </div>
                <div className="contactForm">








                </div>

            </div>


        </div>


    )
}
